     */
    static associate(models) {
      // define association here
    }
  }
  Product.init(
    {
      //id:DataTypes.STRING,
      nameProduct: DataTypes.STRING,
      img: DataTypes.STRING,
      price: DataTypes.FLOAT,
      description: DataTypes.TEXT,
